descriptions:
{'es-ES': '\xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0 \xa0!OPORTUNIDAD!

Bonito chalet pareado de 260 metros aproximados, con unas increíbles\xa0calidades.

Conta de;

Planta sotano;

Garaje para dos vehículos,merendero totalmente acondicionado y aseo.

Plata baja;

Cocina totalmente equipada,amplio salón de 22 metros con salida a terraza y huerto\xa0privado,baño y habitación.

Planta 1ª;

Consta de tres habitaciones, una de ellas suite con salida a terraza, y dos baños.

Ático;

Encontramos un espacio diáfano de 40 metros, y un baño con ducha.

Destacaremos sus extras, pre instalación de aire acondicionado,aspiración central en todas las plantas, mosquiteras, ventanas aluminio con rotura de puente térmico bicolor....

Totalmente amueblado, muebles y electrodomésticos de primera calidad.

Entorno privilegiado, lleno de privacidad y tranquilidad.

Ven a verlo!

\xa0

\xa0

\xa0'}

{'es-ES': 'CASCO VIEJO

Piso en plena almendra medieval de 85 metros cuadrados útiles dividida en 3 dormitorios, 2 baños, salón cocina-unidos. balcón. 

La vivienda se encuentra en buen estado y consta de calefacción individual de gas y trasteros.'}

{'es-ES': 'Ático abuardillado, muy luminoso y amplio. Piso único y especial.
Disponible para visitar.

Contacto: 699630619'}

{'es-ES': 'Vivienda frente a las famosas Salinas.

Vivienda en una bonita casa rural de uno de los pueblos con más encanto de Álava. 

Dispone de 110 metros cuadrados de vivienda en planta baja distribuidos en dos dormitorios, un amplio salón-cocina y baño. ideal para crear un hogar a tu medida reformando lo a tu gusto en un medio rural.'}

{'es-ES': 'Amplia vivienda en la Avenida Gasteiz. Consta de 3 dormitorios, 2 baños completos, salón comedor, cocina y un camarote.

También dispone de una pequeña terraza, y su altura y ubicación proporcionan una maravillosa luminosidad a la vivienda. 

En cuanto al edificio, tiene dos ascensores, obra de accesibilidad en el portal ya realizada, y consta así mismo de servicios de calefacción centrales.'}

{'es-ES': 'Se vende casa con terreno en la población Alavesa de Narvaja/Narbaiza. El inmueble dispone de vivienda, cuadra, almacén aledaño y terreno colindante.

El inmueble está bastante bien conservado, pero requiere de una reforma integral. Actualmente no es habitable.

Visite sin compromiso.'}

{'es-ES': 'Se vende vivienda situada en planta baja, en pleno casco antiguo, completamente rehabilitado.

Consta de vestíbulo, 2 habitaciones, cocina, sala de estar y baño.

Consulte sin compromiso.'}

{'es-ES': 'En el casco urbano de la localidad, INMOBILIARIA ETXAURRE ofrece en EXCLUSIVA\xa0 vivienda de dos habitaciones, salón, cocina con office y baño.

Con una superficie útil de 58 m²\xa0la vivienda cuenta actualmente con una distribución práctica\xa0y ofrece grandes posibilidades de reforma que pueden ajustarse a\xa0las actuales tendencias decorativas,\xa0\xa0facilitando un concepto abierto de espacios. Dispone de gran luminosidad debido a la altura que ocupa en el edificio y de un balcón al que se accede a través de la cocina. Asimismo cuenta con calefacción de gas natural y un trastero.

Ubicada en el corazón de Llodio, en calle peatonal y en edificio de 1964, cuenta en la \xa0zona con la mayor oferta\xa0de servicios, tiendas y ocio. A cinco minutos del transporte público.'}

{'es-ES': 'Estupenda vivienda para reformar   en la calle Gorbea .     Distribuida  en 3 dormitorios , salón .cocina , baño y una terraza.     Calefacción individual.   Ascensor cota 0.     Trastero.   
Muy buena oportunidad.  


'}

{'es-ES': 'Excelente vivienda completamente reformada, con materiales de primera calidad situada en el centro de Laudio con todos los servios a mano.

La vivienda cuenta con un hall distribuidor con acceso a cocina, salón-comedor con acceso a un balcón, tres habitaciones y un baño completo. 

Al tratarse de un cuarto piso goza de gran luminosidad. Piso equipado con todo tipo de comodidades agua caliente, calefacción gas natural, ventanas de PVC sistema Climalit puente térmico, suelo con tarima de elondo, puertas de sapeli, ascensor a cota cero, para evitar las barreras arquitectónicas...'}

{'es-ES': 'Apartamento en la zona de Adurza, con paradas de autobús y tranvia a 2 minutos. La vivienda cuenta con 60m2 ütiles. es exterior y está distribuida en 2 dormitorios, salón, cocina y 1 baño. Dispone de calefacción I.G. Las ventanas son de aluminio blanco con cristal doble. Tiene el suelo de parqué en roble y las puertas son de sapelli. Dispone de un trastero bajo cubierta. Los elementos comunes estan en buen estado y el edificio cuenta con ascensor, portal actualizado, a cota 0. Buena ubicación, servicios de todo tipo, supermercados, farmacia, gimnasio, centro cívico....

Puerta blindada.
Armario empotrado.'}

{'es-ES': 'Excelente vivienda completamente reformada, con materiales de primera calidad situada en el centro de Laudio con todos los servios a mano.

La vivienda muy bien distribuida cuenta según entras con: cocina, amplio salón comedor con gran ventanal y salida a un balcón con vistas muy despejadas, un cuarto de baño con ducha y después nos encontramos con las tres habitaciones.

Piso equipado con todo tipo de comodidades agua caliente, calefacción gas natural, ventanas de PVC sistema Climalit puente térmico, suelo con tarima de roble, puertas de roble, ascensor a cota cero para evitar las barreras arquitectónica y un trastero.'}

{'es-ES': 'Precioso piso, practicamente nuevo,\xa0que cuenta\xa0con 90 metros cuadrados utiles muy bien distribuidos en 3 dormitorios, salón, cocina equipada y 2 baños completos, ademas de un tendedero.

La calefacción es individual de gas y tan solo se pagan 30 euros de gastos de comunidad. Su gran orientación Sur/Oeste asegura luminosidad en el inmueble durante todo el día. Plaza de garaje incluida en el precio y posibilidad de una segunda plaza a negociar precio.
Ven a verlo te encantará'}

{'es-ES': 'Bonito apartamento en el corazón de la ciudad, en la calle Cuchillería: o sea, en la milla de oro de Vitoria-Gasteiz, llamada así por su encantador trasiego de gente de todos los lugares, con sus bares pintorescos, lo que añade a la vivienda una gran comodidad para vivir, al alcance de todos los servicios. El apartamento tiene esa mezcla entre rural y moderna que la hace tan acogedora.

El piso tiene 60 m2 con una amplia estancia para la cocina , comedor y salón, y consta de 1 baño y1 habitación. Tiene trastero. El edificio no tiene ascensor
'}

{'es-ES': 'En venta bonito adosado en el pueblo de Samaniego, se encuentra a 10 km de La Guardia, a 45 km de Vitoria y a 26 km de Logroño. Cuenta con\xa0entrada de acceso directo desde la calle. En la planta baja nos encontramos con : Cocina totalmente equipada, aseo, y gran salón con salida a terraza privada. En la planta primera: 3 dormitorios, y dos cuartos de baño completos, el dormitorio principal en suite con el cuarto de baño incorporado y salida a balcón.En la planta segunda una superficie diáfana ideal para acondicionar a su gusto. Y en planta de sótano tenemos un garaje cerrado y el cuarto de calderas. Ventanas climalit. Armarios empotrados revestidos en todas las habitaciones. Calefacción individual de gasoil.

\xa0

\xa0'}

{'es-ES': 'Bonito adosado seminuevo de 160 metros útiles más terraza de 25 metros.\xa0

4 plantas distribuidas en salón-comedor con cocina completamente amuebladaVivienda seminueva bonita fachada en piedra y raseada . Amplia terraza de 25 metros con acceso desde el salón

Posibilidad de Alquiler con opción de compra'}

{'es-ES': 'Autentica casa alavesa de piedra, se vende casa para reformar, en un entorno muy tranquilo y muy bien comunicado.

En la planta baja tiene diferentes estancias, una de ellas ha sido bar. En la primera planta hay varias habitaciones, una de ellas con chimenea baja de leña, y varios dormitorios en esta planta dispone de calefacción de gasoil. Es una casa bastante grande con muchas posibilidades y crearla al gusto de cada uno.

Tiene un terreno, pajar y cuadras. En el exterior, se encuentra el garaje.'}

{'es-ES': 'Se vende piso VPO en el municipio de Agurain. La vivienda se distribuye en 2 dormitorios, 2 baños, salón-comedor, cocina. Incluído en el precio el trastero y plaza de garaje. 

El edificio, del 2007, cuanta con ascensor cota cero y calefacción central. 

¡Consúltenos sin compromiso!'}

{'es-ES': 'Apartamento\xa0 para entrar a vivir en la calle Cuchilleria, en las cercanias\xa0de la Casa del Cordón.

Se trata de un apartamento de un dormitorio con balcón a la calle, baño y\xa0cocina - salón con una terraza a patio interior.

La vivienda es de estructura de hormigon del año 2001.'}

{'es-ES': 'INMEJORABLE UBICACIÓN. Piso en venta para reformar zona centro, en Calle de Postas, 01004, Vitoria-Gasteiz, Álava, en la planta 2. Es un piso que tiene 114 m2 y dispone de 6 habitaciones. Requiere reforma integral.



busca entre miles ofertas y encuentra tu casa al mejor precio
Encuentra más en http://www.canaltucasa.es'}

{'es-ES': 'PISO EN OYON PUEBLO MUY CÉNTRICO. BUENA EDIFICACIÓN CON ASCENSOR Y TRASTERO.

VIVIENDA DE  3 DORM., 2 BAÑOS, AMUEBLADO, TODO EXTERIOR CON 2 TERRAZAS, DORMITORIO PRINCIPAL TIPO SUITE CON VESTIDOR, TRASTERO DE 14 M2, ASCENSOR.
'}

{'es-ES': 'Se vende piso en planta baja en la localidad alavesa de Campezo, consta de tres habitaciones, cocina-salón y un baño.

El inmueble se encuentra en buen estado de conservación.

Consulte sin compromiso.'}

{'es-ES': 'Se trata de una casa de piedra situada en Berganzo a 9 km de Zambrana, 28 km de Vitoria y a 10 km de Haro (La Rioja). El pueblo es tranquilo y acogedor, se encuentra en las laderas del Toloño y muy cerca de la cascada del río Inglares. Desde su casco urbano comienza la ruta del agua donde podemos disfrutar de bosques de árboles centenarios y cascadas cristalinas.

Está tipificado como local en estructura. El edificio tiene luz, gas, agua y saneamiento, para uso residencial hay que cumplir las normas subsidiarias: adecuación de alturas y hacer tejado. 

En el mismo precio se incluye un terreno rústico de 500 m2 alejado de la vivienda, situado en zona de huertas.'}

{'es-ES': 'Se vende apartamento de VPO con terraza en el municipio de Agurain. La vivienda se distribuye en 2 dormitorios, 2 baños, salón-comerdor-cocina y terraza. Orientado al suroeste. Cuenta además con trastero y plaza de garaje. 

El edificio, del 2007, cuanta con ascensor cota cero y calefacción central. 

¡Consúltenos sin compromiso!'}

{'es-ES': 'Vivienda dúplex distribuida de la siguiente manera; 

En la\xa0planta baja se encuentra la cocina, despensa, salón, terraza y el aseo

En la Primera planta tenemos los 3 dormitorios y el cuarto de baño.\xa0

Dispone de calefacción individual de gas. 

Tiene camarote, cuarto de bicis comunitario y ascensor a cota cero. 

Se queda amueblado.\xa0'}

{'es-ES': 'Estupendo chalet de 150 m² situado en el municipio de Aspárrena en la provincia de Álava.

Cuenta con garaje de 62 m² con una superficie del solar de 1.570 m². Cuenta , tres dormitorios, cocina, dos baños, sala de estar y almacén, además de un precioso porche. En buen estado de conservación.

Aspárrena se sitúa en la Llanada Alavesa, al noreste de la provincia, y a 35 kilómetros de Vitoria, en un entorno agradable, natural y silencioso.'}

{'es-ES': 'En\xa0 Landaluce, barrio tranquilo de la localidad, INMOBILIARIA\xa0 ETXAURRE ofrece \xa0en EXCLUSIVA venta\xa0 de vivienda de 2 habitaciones completamente EXTERIOR.

Ubicada en un edificio de 1964 de fachada lisa, la distribución se establece funcionalmente a lo largo de un\xa0pasillo. Disponiendo de cocina, sala, 2 habitaciones y un\xa0 baño, componen una superficie útil de 51 m².

La vivienda se encuentra reformada parcialmente en 2019. Cuenta con calefacción por acumuladores, ventanas de madera de doble acristalamiento, suelos de elondo y puertas de sapeli. Dispone de un trastero en la parte inferior de edificio y actualmente no dispone de ascensor.'}

{'es-ES': 'Piso en la zona de Txagorritxu, a 3 minutos de la Avenida Gasteiz, con servicios de todo tipo a mano. Se trata de una vivienda de 80m2, distribuidos en 3 dormitorios, salón, cocina y 1 baño. Dispone de calefacción central. Tiene las ventanas de aluminio blanco con cristal climalit. Las puertas son de roble y el suelo de tarima flotante. Dispone de trastero. El edificio cuenta con ascensor. Dispone de rampa de acceso para personas con movilidad reducida.

Puerta blindada.
Orientación E/O.'}

{'es-ES': 'Edificio rural blasonado, en plena Llanada Alavesa. Se trata de una casa solariega en muy buen estado y un conjunto de otros edificios colindantes de otros usos, sobre una parcela Urbana de 3.360 m/2 y con un terreno agrícola colindante de otros 7.200 m/2, según catastro. Junto a la autovía N-1 Irún-Madrid.

Sobre el inmueble se ha realizado un estudio urbanístico, en el que se resalta que se podrían construir varias viviendas unifamiliares sobre los edificios auxiliares y sobre la superficie edificable restante. Una oportunidad de negocio para la promoción de varias viviendas en la zona, donde la demanda es alta.

No dude en consultarnos sobre las características del inmueble.'}

{'es-ES': 'Se vende piso VPO en el municipio de Agurain. La vivienda se distribuye en 3 dormitorios, 2 baños, salón-comedor, cocina. Orientado al suroeste. Incluido en el precio el trastero y plaza de garaje. 

El edificio, del 2007, cuanta con ascensor cota cero y calefacción central. 

¡Consúltenos sin compromiso!'}

{'es-ES': 'Parcela en Añua (Álava) de 2500 m2, con caserío de 416 m2 de superficie en planta baja. 13 está destinado a vivienda, y 23 a cuadra, pajar y almacén. La vivienda consta de planta baja   planta 1ª   desván con altura. La superficie construida son 921 m2, según catastro. El estado de conservación es regular. El edificio se puede rehabilitar para hacer cuatro viviendas. 

Parcela individual de 1000 m2 que se podría vender aparte, haciendo una segregación. Se puede construir una vivienda unifamiliar aislada.

Terreno rústico al lado del río adyacente al caserío y rain anexa, de 3500 m2, que se vende conjuntamente.'}

{'es-ES': 'Se trata de una primera planta dúplex de 75m2 distribuido en 2 habitaciones ( 1 doble y 1 mediana), 1 cuarto de baño, salón comedor y cocina.

Es un piso con mucha luz natural, gracias a tener las vistas totalmente despejadas. Suelos de madera, carpintería exterior con doble vidrio y calefacción en todas las estancias. La finca cuenta con dos ascensores.

Cuenta con una zona común de uso privativo que correspondería a la terraza de la vivienda ( existe la posibilidad de cerrarlo).'}

{'es-ES': 'Chalet individual con piscina y 1.100m2\xa0de jardín a tan sólo 5 kms de Vitoria

En la planta sótano dispone de una bodega y un gran trastero;

En planta baja tenemos el garaje, hall, amplio salón, cocina, aseo y 2 terrazas acristaladas, 

una de ellas con barbacoa, ideal\xa0 para disfrutar en cualquier época del año;

En primera planta,\xa04 habitaciones\xa0y 2 cuartos de baño, el dormitorio principal con vestidor y baño incorporado;

Y en la planta bajocubierta dispone de un espacio diáfano ideal para usar como biblioteca, despacho o dormitorio.

Los 4 dormitorios tienen armarios empotrados y todas las persianas de la casa son motorizadas.\xa0

El jardín tiene riego automático con temporizador; dicho riego así como el llenado de la piscina se realizan con el agua del pozo.

En el exterior hay 2 tejabanas, una de ellas es para aparcar y la otra para utilizar como merendero.

Dispone de placas solares que proporcionan agua caliente y una caldera de leña para calentar la vivienda.

Toda la casa se encuentra vallada con setos\xa0para conseguir completa privacidad.

A tan sólo 5 kms de Vitoria en un entorno natural y muy tranquilo.

\xa0'}

{'es-ES': 'A dos minutos del centro de la localidad, INMOBILIARIA ETXAURRE ofrece en EXCLUSIVA\xa0 vivienda a reformar de 70 m² aprox. útiles\xa0 compuesta por 3 habitaciones, sala, cocina, baño y despensa.

Se trata de una vivienda completamente EXTERIOR, muy LUMINOSA, con orientación SUR que\xa0 se distribuye a lo largo de un pasillo optimizándo así el espacio de las estancias.\xa0Dispone de calefacción de gas natural, puertas de sapeli, suelos de parquet flotante y ventanas de PVC climalit.\xa0

La vivienda se ubica en un edificio sin ascensor de 1962 con la ITE pasada, sin derramas asociadas a corto plazo.\xa0'}

{'es-ES': 'A la venta casa en la población alavesa de Estavillo, perteneciente a la cuadrilla de Añana. Se halla a unos 11 km de Miranda de Ebro y a unos 22 km de Vioria. Se trata de una estrategica localidad ubicada en lo alto de un cerro que mira hacia el río Zadorra, en una encrucijada de caminos.

Ideal como segunda residencia, se encuentra practicamente refomada en el centro de la población con un pequeño garaje cerrado frente a la vivienda.

¡Consulte sin compromiso!'}

{'es-ES': 'Impresionante chalet de 270 metros más 500 metros de parcela en la localidad de Oyón.

La vivienda tiene 3 plantas y se distribuye en 5 dormitorios, 3 baños, 2 cocinas, salón y merendero. Suelos de parquet. Amplios armarios empotrados. Amueblado. Calefacción de gas individual. Garaje..
Impecable,500 metros parcela'}

{'es-ES': 'PISO DE 80 M2 EN LA ZONA DE LAKUA-ARRIAGA, CON PARADA DEL TRANVÍA A 3 MINUTOS Y TODOS LOS SERVICIOS NECESARIOS A MANO. SE TRATA DE UNA VIVIENDA CON 3 DORMITORIOS, SALÓN, COCINA, BAÑO Y ASEO. CUENTA CON SISTEMA DE CALEFACCIÓN CENTRAL. LAS VENTANAS SON DE ALUMINIO CON DOBLE CRISTAL. TIENE LAS PUERTAS Y EL SUELO DE ROBLE. DISPONE TAMBIÉN DE UNA TERRAZA CERRADA. LA VIVIENDA TIENE TRASTERO. EL EDIFICIO TIENE ASCENSOR Y ELEVADOR.

PUERTA BLINDADA.
CALDERA Y RADIADORES NUEVOS.'}
